import React, { useEffect } from "react"
import EventsList from "../components/EventsList"

export default function EventsPage(){
    useEffect(()=>{
       async function FetchEvents(){
          const response=await fetch("/");
          const data=await response.json();
          return data;
        }
    })
    return <>
    <h1> Event page </h1>
        <EventsList/>
    </>
}
